using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// The text input delegate acts as an intermediary between a document and the text input system, conveying notifications of pending or transpired changes in text and selection in the document.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITextInputDelegate_Protocol/index.html#//apple_ref/occ/intf/UITextInputDelegate"/>    [iOSVersion(3.2)]    [Export("")]    public interface UITextInputDelegate//: NSObjectProtocol    {        /// <summary>        /// Tells the input delegate when text is about to change in the document. (required)        /// </summary>        /// <param name="textInput">The document instance whose class adopts the UITextInput protocol.</param>        [iOSVersion(3.2)]        [Export("textWillChange")]        void TextWillChange(UITextInput textInput);                /// <summary>        /// Tells the input delegate when text has changed in the document. (required)        /// </summary>        /// <param name="textInput">The document instance whose class adopts the UITextInput protocol.</param>        [iOSVersion(3.2)]        [Export("textDidChange")]        void TextDidChange(UITextInput textInput);                /// <summary>        /// Tells the input delegate when the selection is about to change in the document. (required)        /// </summary>        /// <param name="textInput">The document instance whose class adopts the UITextInput protocol.</param>        [iOSVersion(3.2)]        [Export("selectionWillChange")]        void SelectionWillChange(UITextInput textInput);                /// <summary>        /// Tells the input delegate when the selection has changed in the document. (required)        /// </summary>        /// <param name="textInput">The document instance whose class adopts the UITextInput protocol.</param>        [iOSVersion(3.2)]        [Export("selectionDidChange")]        void SelectionDidChange(UITextInput textInput);    }}